import React, { useState } from 'react';
import { Table, Col, Row, Button, Form } from 'react-bootstrap';
import generateProtocolsFunction from './GenerateProtocolFunction';
import styles from '../FormsBase.module.css';

function GenerateProtocols({ composition_of_sec, groups_for_schedule, requestAndWorkProtection, data }) {
  const [selectedGroup, setSelectedGroup] = useState(groups_for_schedule[0]?.name || '');
  const [selectedGroupStudents, setSelectedGroupStudents] = useState([]);

  const handleClick = async () => {
    const groupData = requestAndWorkProtection.filter(item => item.request.student.group.name === selectedGroup);
    await generateProtocolsFunction({
      composition_of_sec: composition_of_sec,
      selectedGroup: selectedGroup,
      groupData: groupData,
      data: data
    });
  };

  const countRequestsPerGroup = () => {
    const groupCounts = {};
    requestAndWorkProtection.forEach(item => {
      const groupName = item.request.student.group.name;
      if (groupCounts[groupName]) {
        groupCounts[groupName]++;
      } else {
        groupCounts[groupName] = 1;
      }
    });
    return groupCounts;
  };

  const groupCounts = countRequestsPerGroup();

  const handleGroupChange = (groupName) => {
    const students = requestAndWorkProtection.filter(item => item.request.student.group.name === groupName).map(item => item.request.student);
    setSelectedGroup(groupName);
    setSelectedGroupStudents(students);
  };

  return (
    <div>
      <h4 className='text-center'>Генерация протоколов</h4>
      <Form>
        <Row className='justify-content-center'>
          <Col md={7}>
            <Form.Group controlId="groupSelect">
              <Form.Label>Выберите группу</Form.Label>
              <Form.Control as="select" value={selectedGroup} onChange={(e) => handleGroupChange(e.target.value)}>
                <option value="">Выберите группу</option>
                {groups_for_schedule.map(group => (
                  <option key={group.id} value={group.name}>
                    {group.name} ({groupCounts[group.name] || 0} чел.)
                  </option>
                ))}
              </Form.Control>
            </Form.Group>
          </Col>
          <Col md={3}>
            Выберите группу и система сгенерирует протоколы на всю группу. Номер, дата протокола и время выступления будут совпадать с временем, обозначенным на странице пофамильного расписания защит ВКР
          </Col>
        </Row>
        {selectedGroup && (
          <Row className='justify-content-center my-3'>
            <Col md={10}>
              <Table striped bordered hover>
                <thead>
                  <tr>
                    <th>#</th>
                    <th>Фамилия</th>
                    <th>Имя</th>
                    <th>Отчество</th>
                  </tr>
                </thead>
                <tbody>
                  {selectedGroupStudents.map((student, index) => (
                    <tr key={index}>
                      <td>{index + 1}</td>
                      <td>{student.user.last_name}</td>
                      <td>{student.user.first_name}</td>
                      <td>{student.user.patronymic}</td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            </Col>
          </Row>
        )}
      </Form>
      <Row className='justify-content-center my-3'>
        <Col md={2}>
          <Button variant='light' className={styles.button1} onClick={handleClick} disabled={!selectedGroup}>Создать протокол</Button>
        </Col>
      </Row>
    </div>
  );
}

export default GenerateProtocols;
